import styled from "styled-components";
import { Navbar } from "../Navbar";
import { Sidebar } from "../Sidebar";

const Container = styled.div`
  box-sizing: border-box;
  padding: 176px 32px 0 240px;
  transition: all 0.3s;
`;

export function Index() {
  return (
    <>
      <Navbar />
      <Sidebar />
    </>
  );
}
